ChIJuZIa5nt9uRQR1R1JMpHHcmg	Y√ºzellidokuz Patisserie & Espresso	4	\N	{"Such a cool place!! Everybody was so friendly and service was great.. desserts üëåüèªüëåüèªüëåüèª","I would like to start with the fact that their employees are very respectful and caring. Desserts are artisan bakery products. Their croissants are good, but I think it would suit them as a business style if they diversify the salty sandwiches and enrich them with special ingredients rather than just 2-3 ingredients.\n\nThe ambiance is really nice. It is suitable for both going with friends and working alone.\nThere is a wonderful light inside, especially at noon. If you come at a quiet time, it will be delicious.\nTheir coffee is delicious.\nIf you are going to use public transportation, transportation is also easy.\n\nThis is 1 of the 2 places I recommend in Bornova.","The interior design is very stylish. I'm sure the street will be more beautiful when the road work is completed. Unfortunately, not every dessert on the dessert menu was available. However, we went in the early hours. We tried the meringue and it smelled a bit like egg. Their lattes were delicious. The service was fine.","The interior has a very spacious seating area, the lights, plants, harmonious use of wood and marble, and the brightness of the interior creates a feeling of spaciousness. You immediately feel like you are sitting in a good place. The young people working at the place I went to with my son were very friendly, clean and well-dressed. Their coffee was incredibly intense and delicious. We could only eat 1 dessert for now, but the taste remained on our palate. We are looking forward to trying the square croissants with my son. We liked it very much, we wish you to keep your smiling face and add beauty to Bornova without compromising your quality tastes.","We ate peanut cup croissants. It was Q90 TL. It's quite enough for two people"}
